import { Box, Flex, Heading, Image, Link, Text } from "@chakra-ui/react";
import NavBar from "../components/Navigasi";
import Footer from "../components/Footer";
import wa from "../assets/whatsapp2.png";


const Contact = () => {

    const contact = "https://wa.me/6281215267243";
    
    return(
        <>
        <NavBar/>
        <Box h={"100vh"} bgColor={"#F5F7FA"} bgSize={"cover"}>
            <Flex gap={"10"} paddingTop={"170px"} flexDirection={"column"} paddingLeft={"80px"} paddingRight={"80px"}>
                <Heading fontWeight={"bold"} fontSize={"40px"}>~ Contact</Heading>

                <Text fontWeight={"medium"} fontSize={"3xl"} paddingTop={"50px"}>
                    Get In Touch
                </Text>

                <Link href={contact}>
                    <Image src={wa}></Image>
                </Link>
            </Flex>
        </Box>   
        <Footer/> 
        </>
    )
};

export default Contact;
